import './App.css';
import React from 'react';
import { useEffect } from 'react';
import { ReactDOM, render } from 'react-dom';
import { useState } from 'react';
import GameStatus from "./container/Gameflow"
import All_car from "./container/Gameflow"
import Redcar from "./container/Gameflow"




   


function App() {
  var [left_right,lr_value]=useState(30) ;
  var [button,buton_value]=useState(0);

  function Onclick(){
              // GameStatus();
            buton_value(button + 1)
            }   
  function Turn_right(){
    
    if (left_right<62){
              lr_value(left_right+3)
              console.log(left_right)}
            }
      
  function Turn_left(){
              if (left_right>2){ 
                lr_value(left_right-3)
                console.log(left_right)}
              }
  return (
    
    <body className='body'>
      
      <header className='header'>
        <img className='logo1' src='https://www.bing.com/th?id=OIP.TLKTJDEq6qu4ECeo7LGkYwHaEu&pid=3.1&cb=&w=300&h=300&p=0' alt=''></img>
        <h2>Tinny cars</h2>
        <img className='logo2' src='https://www.bing.com/th?id=OIP.TLKTJDEq6qu4ECeo7LGkYwHaEu&pid=3.1&cb=&w=300&h=300&p=0' alt=''></img>
        </header>
      <nav className='nav'>
        <h1><a>Login</a></h1>
        <h1><a>Home</a></h1>
        <h1><a>About</a></h1>
      </nav> 

      <div className='body'>
        <section className='road'>
        <button style={{
          position:'relative',
          zIndex:"10"
          }} onClick={Onclick}>score :{button}</button>
        <section className='running_cars'>
          
            <All_car />
            
            

          </section>
          <GameStatus/>
          <nav  className='main_car' id="main" style={{ 
            position :"relation" ,
            zIndex:"20",
            marginLeft: left_right+"vw"}}>
          </nav>

          <div >
             <div className='bottom'>
             <button className='leftbutton' onClick={Turn_left}></button>
              <button className='rightbutton' onClick={Turn_right}></button></div>
          </div>
          </section>
          </div>
      <footer>Footer</footer>

    </body>
  
    
  );
}

export default App;
